import { useState } from "react";
import DirectButton from "../components/directButton";

const [username, setUsername] = useState('');
const [password, setPassword] = useState('');

function getPassword() {
  return password;
}

function getUsername() {
  return username;
}

export default function Login() {
  return (
    <div>
      <div>
        <h1>Please log in to access your restaurant</h1>
        <form>
          <label>Username:</label>
          <br />
          <input onChange={evt => setUsername(evt.target.value)}/>
          <br />
          <label>Password:</label>
          <br />
          <input onChange={evt => setPassword(evt.target.value)}/>
        </form>
        <DirectButton text="Submit" route="/home"/>
      </div>
    </div>
  );
}
